import React from "react";
import Sidebar from "./components/shared/Sidebar";
import "./App.css";
import Navbar from "./components/shared/Navbar";
import Dashboard from "./components/pages/Dashboard";

function App() {
  return (
    <div className="App">
      <div>
        <Navbar></Navbar>
        <div style={{ display: 'flex' }}>
          <Sidebar></Sidebar>
          <Dashboard></Dashboard>
        </div>

      </div>


    </div>
  );
}

export default App;
